import 'dart:isolate';

void main() async {
  print('started');
  for (var i = 0; i < 10; i++) {
    await run1();
    await run2();
    await run3();
  }
  final s3 = Stopwatch()..start();
  for (var i = 0; i < 10; i++) {
    await run3();
  }
  print(s3.elapsedMicroseconds);

  final s = Stopwatch()..start();
  for (var i = 0; i < 10; i++) {
    await run1();
  }
  print(s.elapsedMicroseconds);

  final s2 = Stopwatch()..start();
  for (var i = 0; i < 10; i++) {
    await run2();
  }
  print(s2.elapsedMicroseconds);
}

Future<void> run1() async {
  //final t = test*2;

  final f = () {
    assert(test[10] != 'a');
  };
  await Isolate.run(() {
    f();
  });
}

Future<void> run3() async {
